import React, { Component } from "react";
class Home extends Component {
  render() {
    return (
      <div class="slide-container">
         <div className = "image-container">
              <div className ="slide-image"> <img src ="./images/gasy.jpeg" alt=""/></div>
              <div className ="slide-image"> <img src ="./images/kely.jpeg" alt=""/></div>
              <div className ="slide-image"> <img src ="./images/vory.jpeg" alt=""/></div>
           <div className ="button-container">

           </div>
     </div>
      </div>

    );
  }
}

export default Home;
